<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="UTF-8" />
<meta name="viewport" content="width=device-width, initial-scale=1.0"/>
<title>Rota da Baleia-Jubarte</title>
<style>
@import url('https://fonts.googleapis.com/css2?family=Press+Start+2P&display=swap');

body {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
    font-family: 'Press Start 2P', monospace;
    background: #0f0f23;
    min-height: 100%;
    overflow-x: hidden;
    position: relative;
    image-rendering: pixelated;
}

html { height: 100%; }

.bubbles {
    position: fixed;
    top: 0; left: 0;
    width: 100%; height: 100%;
    pointer-events: none;
    z-index: 1;
}
.bubble {
    position: absolute;
    background: #00ffff;
    width: 4px; height: 4px;
    border-radius: 0;
    animation: pixelFloat 4s infinite linear;
    box-shadow: 0 0 2px #00ffff;
}
@keyframes pixelFloat {
    0% { transform: translateY(100vh); opacity: 0; }
    10% { opacity: 1; }
    90% { opacity: 1; }
    100% { transform: translateY(-50px); opacity: 0; }
}

.waves {
    position: fixed;
    bottom: 0; left: 0;
    width: 100%; height: 60px;
    background: repeating-linear-gradient(
        90deg,
        #1a1a3a 0px,
        #1a1a3a 8px,
        #2a2a4a 8px,
        #2a2a4a 16px
    );
    animation: pixelScroll 2s linear infinite;
    z-index: 1;
}
@keyframes pixelScroll { 0% { transform: translateX(0); } 100% { transform: translateX(16px); } }

.container {
    position: relative;
    z-index: 10;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 20px;
}

.narrative-screen { display: block; text-align: center; color: white; max-width: 600px; }
.narrative-content {
    background: #1a1a3a;
    padding: 25px;
    border: 3px solid #00ffff;
    border-radius: 0;
    box-shadow: inset 0 0 15px rgba(0,255,255,0.2);
    margin-bottom: 30px;
}
.narrative-title {
    font-size: 1.2rem;
    margin-bottom: 20px;
    color: #00ffff;
    text-shadow: 2px 2px 0px #0066cc;
    letter-spacing: 1px;
}

.whale-route {
    position: absolute;
    width: 12px; height: 12px;
    background: #ffff00;
    border: 2px solid #ffffff;
    border-radius: 0;
    box-shadow:
        inset 1px 1px 0px #ffff88,
        inset -1px -1px 0px #cc9900,
        1px 1px 0px #000000;
    opacity: 0;
    image-rendering: pixelated;
}

.route-point-1 { top: 82%; left: 48%; transform: translate(-50%,-50%); }
.route-point-2 { top: 66%; left: 45%; transform: translate(-50%,-50%); }
.route-point-3 { top: 54%; left: 42%; transform: translate(-50%,-50%); }
.route-point-4 { top: 52%; left: 38%; transform: translate(-50%,-50%); }

.globe-whale {
    position: absolute;
    font-size: 2.2rem;
    z-index: 10;
    filter: drop-shadow(2px 2px 0px #0066cc);
    transition: all 2s ease-in-out;
    top: 82%; left: 48%;
    transform: translate(-50%,-50%) rotate(0deg);
}

@keyframes routeGlow {
    0%, 100% { opacity: 0.8; transform: scale(1); background: #ffff00; }
    50% { opacity: 1; transform: scale(1.3); background: #ffffff; }
}

@keyframes whaleToPoint2 {
    0% { transform: translate(-50%,-50%) rotate(0deg); top:82%; left:48%; }
    100% { transform: translate(-50%,-50%) rotate(-15deg); top:66%; left:45%; }
}
@keyframes whaleToPoint3 {
    0% { transform: translate(-50%,-50%) rotate(-15deg); top:66%; left:45%; }
    100% { transform: translate(-50%,-50%) rotate(-25deg); top:54%; left:42%; }
}
@keyframes whaleToPoint4 {
    0% { transform: translate(-50%,-50%) rotate(-25deg); top:54%; left:42%; }
    100% { transform: translate(-50%,-50%) rotate(-30deg); top:52%; left:38%; }
}

@keyframes pixelBob {
    0% { transform: translateY(0); }
    50% { transform: translateY(-2px); }
    100% { transform: translateY(0); }
}
</style>
</head>
<body>
<div class="bubbles" id="bubbles"></div>
<div class="waves"></div>

<div class="container">
    <div class="narrative-screen">
        <div class="narrative-content">
            <div class="narrative-title">🌍 Rota da Baleia-Jubarte</div>

            <div class="globe-animation" id="globeAnimation">
                <div class="whale-route route-point-1" id="routePoint1"></div>
                <div class="whale-route route-point-2" id="routePoint2"></div>
                <div class="whale-route route-point-3" id="routePoint3"></div>
                <div class="whale-route route-point-4" id="routePoint4"></div>
                <div class="globe-whale" id="globeWhale">🐋</div>
            </div>
        </div>
    </div>
</div>

<script>
const whale = document.getElementById('globeWhale');
const routePoints = [
    document.getElementById('routePoint1'),
    document.getElementById('routePoint2'),
    document.getElementById('routePoint3'),
    document.getElementById('routePoint4')
];

routePoints.forEach((p, i) => setTimeout(() => {
    p.style.opacity = '1';
    p.style.animation = 'routeGlow 1.6s ease-in-out infinite';
}, i * 500));

setTimeout(() => whale.style.animation = 'whaleToPoint2 2s ease-in-out forwards', 500);
setTimeout(() => whale.style.animation = 'whaleToPoint3 2s ease-in-out forwards', 2500);
setTimeout(() => whale.style.animation = 'whaleToPoint4 2s ease-in-out forwards', 4500);
setTimeout(() => whale.style.animation = 'pixelBob 1s steps(2) infinite', 6500);
</script>
</body>
</html>
